import React from 'react'
import {Container, Card, Button} from "react-bootstrap";
import styled from "styled-components";


export const MyNFTCard = styled(Card)`
    border-radius: 8px;
    height: auto;
    width: auto;
    background-color: #1D1E20;
    box-shadow: 0px 3px 15px rgba(0,0,0,0.2);
`
const MyNFTCardContainer = styled(Container)`
    display: flex;
    flex-direction: column;
    padding: 12px;
    align-items: flex-start;
    align-content: flex-start;
    justify-content: space-around;
    gap: 8px;

    @media (max-width: 768px) {
        flex-direction: column;
      }
`
const NFTImageWrapper = styled.img`
    border-radius: 5px;
`
const NFTBrandName = styled.p`
    font-size: 70%;
    color: #fbdb37;
`
const NFTTitle = styled.h3`
    font-size: 120%;
    font-weight: 600;
    color: #fbfbfb;
`
const NFTLineBreak = styled.hr`
      color: #393C3F;
      width: 100%;
`
const PriceRow = styled(Container)`
    display: flex;
    flex-direction: row;
    padding: 0px;
    width: 100%;
    margin: 0px;
    align-content: space-between;
    justify-content: space-between;
    gap: 12px;
`

const NFTCard = (props) => {
    return (
        <>
           <MyNFTCard>
                <MyNFTCardContainer>
                <NFTImageWrapper src={props.image}></NFTImageWrapper>
                <NFTBrandName>CornFinance</NFTBrandName>
                <NFTTitle>{props.title}</NFTTitle>
                <NFTLineBreak size="8"/>
                <PriceRow>
                    <NFTBrandName>Asking Price</NFTBrandName>
                    <NFTTitle><EthIcon />100.00</NFTTitle>
                </PriceRow>


                <NFTFooter id={props.id}></NFTFooter>  
                </MyNFTCardContainer>
            </MyNFTCard> 
        </>
    )
}

export default NFTCard
